import React from 'react'
import { Box, FormControl, InputLabel } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles';
import PropTypes from 'prop-types';
import Text from '../text';
import Select from '../select'

const styles = {
    root : {
        width :350,
        height : 400,
        backgroundColor : "rgba(238,238,238,0.8)",
        borderRadius : 10,
        padding : 20,
        paddingLeft : 20,
        paddingRight : 20
    },
    margin : {
        width : "100%"
    }
}

const Bookings = ({ classes, servicesPlaceholder }) => {

    return <Box className={classes.root}>
        <Box>
            <Text variant="h6" fWeight={600} ffamily="Poppins">Select Our Services</Text>
        </Box>
        <Box>
            <FormControl variant="outlined" margin='dense' className={classes.margin}>
                <InputLabel htmlFor="outlined-age-native-simple">{servicesPlaceholder}</InputLabel>
                <Select
                    native
                    // value={state.age}
                    // onChange={handleChange}
                    label={servicesPlaceholder}
                    inputProps={{
                        name: 'service',
                        id: 'outlined-service',
                    }}

                >
                    <option aria-label="None" value="" />
                    <option value={10}>Ten</option>
                    <option value={20}>Twenty</option>
                    <option value={30}>Thirty</option>
                </Select>
            </FormControl>
        </Box>
    </Box>
}

Bookings.propTypes = {
    servicesPlaceholder : PropTypes.string,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Bookings)
